I agree with @jimmy_dore on all points.

@BernieSanders let down the very movement that made him by sending signals his opponents were at all viable to beat Trump.

Did he really want to win? Only he knows. But there is definitely doubt given his strategy. https://t.co/R4nu5FfJBR

When wealthy CEOs tell you they don't need to be bailed out, listen to them.

People think Occupy Wall Street was disruptive?

@corona_strike is organizing people for a nationwide #GeneralStrike that will bring these CEOs to their knees. https://t.co/9kbxgYtsX3
